INSERT INTO `artikel` (`A_ID`, `A_Name`, `A_Beschreibung`, `A_Preis`, `A_Bild`, `kategorie_ID`) VALUES
(1, 'IPhone 12 Pro', '5G Geschwindigkeit. A14 Bionic, der schnellste Chip in einem Smartphone. Ein All‑Screen OLED Display. Der Ceramic Shield mit einer viermal besseren Sturzfestigkeit. Und Nachtmodus bei jeder Kamera. Das IPhone 12 Pro hat alles. Sogar zwei perfekte Größen.\r\n\r\n', '825', , 1);
INSERT INTO `artikel` (`A_ID`, `A_Name`, `A_Beschreibung`, `A_Preis`, `A_Bild`, `kategorie_ID`) VALUES
(2, 'Macbook Pro 13,3 Zoll', 'Der Apple M1 Chip gibt dem 13\" MacBook Pro unglaub­liche Geschwin­digkeit und Power. Mit bis zu 2,8x mehr CPU Leistung. Bis zu 5x höherer Grafik­geschwindigkeit. Unserer fortschritt­lichsten Neural Engine für bis zu 11x schnelleres maschinelles Lernen. Und bis zu 20 Stunden Batterie­laufzeit – der längsten, die es je in einem Mac gab. Es ist unser beliebtestes Pro Notebook auf einem ganz neuen Level.', '1449', , 3);
INSERT INTO `artikel` (`A_ID`, `A_Name`, `A_Beschreibung`, `A_Preis`, `A_Bild`, `kategorie_ID`) VALUES
(3, 'iPad Pro', 'Er ist eine magische Fläche aus Glas. Er ist so schnell, dass die meisten PC Laptops nicht mitkommen. Er hat Pro Kameras, die deine Realität verändern können. Und du kannst ihn mit einer Berührung, dem Apple Pencil, einem Keyboard und jetzt mit dem Trackpad nutzen. Dein nächster Computer ist das neue iPad Pro.', '1132', , 2);
INSERT INTO `artikel` (`A_ID`, `A_Name`, `A_Beschreibung`, `A_Preis`, `A_Bild`, `kategorie_ID`) VALUES
(4, 'Samsung Galaxy Tab A7', 'Eleganz mit einem Hauch von Luxus: Das Gehäuse in Mystic Black verleiht dem Tablet einen ganz eigenen Charakter. Als Betriebssystem ist Android 10.0 One UI 2.5 Knox 3.6 auf dem Gerät von SAMSUNG bereits installiert.\r\n\r\nSAMSUNG stellt Ihnen zum Speichern Ihrer Daten einen internen Speicher von 128 GB zur Verfügung. Der Speicherkartentyp Micro-SD kann mit dem Produkt von SAMSUNG verwendet werden. Ob Fotos machen, Onlineshopping oder einfach nur im Web surfen – mit dem großzügigen Arbeitsspeicher von 6 GB klappt dies spielend einfach.\r\n\r\nSAMSUNG hat sich bei dem eingebauten Akku um Systemkomponenten mit einer Kapazität von 7.760 mAh entschieden.', '599', , 2);
INSERT INTO `artikel` (`A_ID`, `A_Name`, `A_Beschreibung`, `A_Preis`, `A_Bild`, `kategorie_ID`) VALUES
(5, 'Samsung Galaxy S21 Ultra', 'Wir stellen vor: das Galaxy S21 Ultra 5G. Ausgestattet mit einer formschönen Kamera, die die Fotografie neu erfindet – so kannst du 8K-Videos in Kinoqualität und epische Standbilder gleichermaßen aufnehmen. Und dank dem schnellsten Chipsatz, den Galaxy zu bieten hat, dem stärksten Glas, 5G-Kompatibilität und einem Ganztags-Akku macht das Ultra seinem Namen alle Ehre.', '1199', , 1);
INSERT INTO `artikel` (`A_ID`, `A_Name`, `A_Beschreibung`, `A_Preis`, `A_Bild`, `kategorie_ID`) VALUES
(6, 'Asus ZenBook Pro Duo 15,6 Zoll', 'Hebe Deine Kreativität und Produktivität mit dem bahnbrechenden ASUS ZenBook Pro Duo auf die nächste Stufe! Das einzigartige 4K ASUS ScreenPad™ Plus bietet Dir den ultimativen Vorteil in Sachen Workflow-Effizienz und arbeitet nahtlos mit dem 4K UHD OLED Hauptbildschirm zusammen. Genieße eine erweiterte Arbeitsfläche, um praktischer, schneller und angenehmer zu arbeiten.', '2699', , 3);

